import React from 'react';
import { useForm } from 'react-hook-form';

import { FormHidden } from 'components';
import { withKnobs, text } from '@storybook/addon-knobs';
import { Box } from '@material-ui/core';

export default {
  title: 'FormHidden',
  component: FormHidden,
  decorators: [withKnobs],
};

export const Default = () => {
  const { control, errors, setValue } = useForm({
    defaultValues: [],
  });
  const fields = [
    {
      label: 'Hidden field label',
      name: 'Hidden field',
      type: 'HIDDEN',
      validation: {
        required: true,
        message: 'This field is required',
      },
      hint: 'Hint goes here',
      gridSize: {
        xs: 5,
        sm: 4,
        md: 4,
        lg: 4,
        xl: 4,
      },
    },
  ];
  const renderFields = fields.map((field, index) => {
    const { gridSize, ...props } = field;
    return (
      <FormHidden
        {...props}
        control={control}
        onChange={(file) => setValue(field.name, file, { shouldDirty: true })}
        key={`form_${index}_${field.name}`}
        name={text('Name', field.name)}
        error={text('Error', errors[field.name])}
        label={text('Label', field.label)}
        hint={text('Hint', field.hint)}
      />
    );
  });

  return <Box>{renderFields}</Box>;
};
